import { createRouter, createWebHistory } from 'vue-router'

import Lista1View from '@/views/lista1/Lista1View'
import ItemDetailView from '@/views/lista1/ItemDetailView'
import Lista2View from '@/views/Lista2View'
import ContactoView from '@/views/ContactoView'
import SpaceView from '@/views/space/SpaceView'
import Page404 from '@/views/Page404View'
import ItemA from '@/components/items/ItemA'
import ItemB from '@/components/items/ItemB'
import ItemC from '@/components/items/ItemC'
import ItemD from '@/components/items/ItemD'
import Ruta from '@/components/items/Ruta'


const routes = [
  {
    path: '/',
    component: Lista1View,
    name: 'home'
  },
  {
    path: '/item-detail/:id',
    component: ItemDetailView,
    name: 'item-detail'
  },
  {
    path: '/url2',
    component: Lista2View,
    name: 'lista-2'
  },
  {
    path: '/url3',
    component: ContactoView,
    name: 'lista-3'
  },
  {
    path: '/space',
    component: SpaceView,
    children: [
      {
        path: '',
        component: ItemA,
        name: 'space'
      },
      {
        path: 'item-b',
        component: ItemB,
        name: 'item-b'
      },
      {
        path: 'item-c',
        component: ItemC,
        name: 'item-c'
      },
      {
        path: 'item-d/:id',
        component: ItemD,
        name: 'item-d',
        query: null
      }

    ]
  },
  {
    path: '/ruta',
    component: Ruta,
    name: 'ruta'
  },
  {
    path: '/:pathMatch(.*)*',
    component: Page404
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
